import Game from "./Game";
import Rules from "./rules";
import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <Switch>
      <Route path="/" exact>
        <Game />
      </Route>
      <Route path="/rules" exact component={Rules} />
    </Switch>
  );
}

export default App;
